import React from 'react';
import GuestList from './components/GuestsList'; // Agregando el componente para listar invitados
import AddGuestForm from './components/AddGuestsForm'; // Agregando el componente para agregar invitados
import ModifyGuestForm from './components/ModifyGuestsForm'; // Agregando el componente para modificar invitados
import DeleteGuestForm from './components/DeleteGuestsForm'; // Agregando el componente para eliminar invitados

const App = () => {
  return (
    <div>
      <h1>CONTROL INVITADOS</h1>
      <AÑADIR INVITADO />
      <MODIFICAR INVITADO />
      <BORRAR INVITADO />
      <OBTENER LISTA INVITADOS />
    </div>
  );
};

export default App;
